    false,nt"url": null,nt"notes": "This narrative report for Blackwater NWR
    outlines Refuge accomplishments from September through December of 1961. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, and raptors-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, and vegetation control. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge visitors, Refuge participation,
    and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
